Common.LongDescription.Common.Text:
1100 Hay Street, West Perth is a high quality refurbished six level office building positioned at the gateway to West Perth, within short walking distance to the Perth CBD and freeway network.

This iconic building features unparalleled tenant amenity, including;

- Tennis Court with entertainment facilities and changing rooms;
- End of Trip facilities including showers, lockers and secure bicycle parking;
- On-site facilities management;
- Central core with 360 degrees of natural light and excellent views over Parliament Place, Perth CBD and surrounds;
- High car parking availability; and,
- Proximity to public transport and retail amenity.

Current Availability:

Level 6 - 1,240sqm: Fully refurbished top floor tenancy. 

Level 5 - 1,284sqm: Fully refurbished whole floor tenancy. 

Level 4 - 1,283sqm: Fully fitted tenancy featuring a reception, 2 x boardrooms, 2 x meeting rooms, 9 x offices, kitchen/breakout and open plan workstations. 

Level 3 - 1,285sqm: Fully fitted tenancy featuring a large kitchen/breakout area, boardroom, 5 x meeting rooms, 5 x offices, open plan workstations and storage/utilities. 

Level 2 - 1,161sqm: Subject to full refurbishment. 

Outgoings are currently estimated at $157.72/sqm for the 2021/22 financial year.

For any queries, please contact the joint agents.
